import React from 'react';
import './css/imageSlide.css';

const ImageSlide = (props) => {
  const styles = {
    backgroundImage: `url('https://m.media-amazon.com/images/M/MV5BOGVhNjUwYTItYmI2NS00ZGI1LWE5ZDQtMWVjMTIyODAzMDI4XkEyXkFqcGdeQXVyMjQ3NzUxOTM@._V1_UY1200_CR109,0,630,1200_AL_.jpg')`,
    backgroundSize: 'cover',
    backgroundPosition: '50% 24%',
    filter:blur("10px"),
    height:"2860px",
    width:"1280px",
   };

  return(
    <div className="image-slide" style={styles}></div>
  )
}

export default ImageSlide;
